    "2016-07-27T22:38:25.617302",nt"name": "summary-of-algal-community-changes-observed-on-the-southwest-arm-of-rose-atoll-from-1995-2",nt"isopen":
    false,nt"url": null,nt"notes": "This brief summary of observed changes
    in the reef-top algal community at Rose Atoll NWR is prepared specifically to address
    the questions posed by the NPFC on 12/4/02. These questions can be paraphrased as:
    1) Do the algal data collected in 2002 show evidence of ecosystem recovery compared
    to previous samples? 2) Specifically, was debris removal in 1999-2000 followed by
    a reduction in opportunistic algae and increased growth of crustose coralline algae?
    Four quantitative surveys of the algal community on the intertidal reef at Rose
    Atoll have been conducted, all subsequent to the grounding of the Jin Shiang Fa
    in October 1993. The absence of baseline data prevents us from specifying a u201crecoveredu201d
    condition of the benthic community. However, inferences can be made by examining
    the spatial and temporal changes in the major algal types in relation to the wreck
    site and cleanup efforts.",nt"license_title": "License Not Specified",nt"extras":
